  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import {NASA_RED, NASA_WARM_GREY, NASA_DARK, NASA_LIGHT} from '../'

export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"colours"}}>{`Colours`}</MDXTag>

<div style={{width: '200px', height: '200px', background: `${NASA_RED}`}}></div>
<div style={{width: '200px', height: '200px', background: `${NASA_WARM_GREY}`}}></div>
<div style={{width: '200px', height: '200px', background: `${NASA_DARK}`}}></div>
<div style={{width: '200px', height: '200px', background: `${NASA_LIGHT}`}}></div>
           </MDXTag>
  }
}
